import React from "react";
import "./ExpenseForm.css";
const ExpenseForm = () =>{
      return (
            <div>
                  <form>
                        <div className="new-expense__controls">
                              <div>
                                    <label>Title</label>
                                    <input type='text' />
                              </div>
                        </div>
                  </form>
            </div>
      )
}

export default ExpenseForm;
